import styled from "styled-components";

export const Wrapper = styled.div`
  display: block;

  h1 {
    text-align: center;
    margin: 40px 0 40px 0;
  }

  .intro-background {
    background-color: #f6f6f6;
    padding: 10px 0 50px 0;
  }

  a {
    font-weight: 200;
  }
`;

export const Intro = styled.div`
  margin: 0 25% 0 25%;
  text-align: center;

  h2 {
    font-weight: 500;
  }

  p {
    text-align: left;
    font-weight: 200;
  }
`;
